import React from 'react'


const attributes = {
    str: 0,
    constitution: 0,
    dexterity: 0
}

class Hero extends React.Component() {
    render() {
        const str = this.props.str;
        const constitution = this.props.constitution;
        const dexterity = this.props.dexterity;
        return (
            <div>
                <p>Str = {str}</p>
                <p>Constitution = {constitution}</p>
                <p>Dexterity={dexterity}</p>
            </div>
        );
    }
}

export default Hero;
